contracts/BugcatCodex.sol.content:
// SPDX-License-Identifier: WTFPL
pragma solidity ^0.8.30;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/common/ERC2981.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/utils/Base64.sol";

interface IBugcatsRegistry {
    function bugs(uint256) external view returns (address);
}

interface IRender {
    function render(
        uint256 tokenId,
        address caretaker,
        address bugcat,
        string memory code,
        bool light,
        bool compiled
    ) external view returns (string memory);
}

contract BugcatCodex is ERC721, ERC2981, Ownable {
    using Strings for uint256;

    IBugcatsRegistry public immutable registry;
    uint256 public immutable bugcatCount;

    address public minter;
    address public renderer;
    mapping(address => string) public codes;
    mapping(uint256 => uint8) public bugcatIndexes;
    mapping(uint256 => bool) public lights;
    mapping(uint256 => bool) public compileds;

    event Mint(address indexed to, uint256 indexed tokenId, uint8 bugcatIndex);

    constructor(
        address _owner,
        address _registry,
        uint8 _bugcatCount,
        address _renderer,
        address _royaltyReceiver
    ) ERC721("BUGCAT Codex", "CODEX") Ownable(_owner) {
        registry = IBugcatsRegistry(_registry);
        bugcatCount = _bugcatCount;
        minter = _owner;
        renderer = _renderer;
        _setDefaultRoyalty(_royaltyReceiver, 1000);
    }

    function setMinter(address m) external onlyOwner {
        minter = m;
    }

    function setRenderer(address r) external onlyOwner {
        renderer = r;
    }

    function setDefaultRoyalty(address receiver, uint96 bps) external onlyOwner {
        _setDefaultRoyalty(receiver, bps);
    }

    function rememberCode(address bugcat, string memory code) external onlyOwner {
        codes[bugcat] = code;
    }

    function mint(address to, uint256 tokenId) public {
        require(msg.sender == minter, "not minter");
        _mint(to, tokenId);
        uint8 bugcatIndex = _choose(0);
        bugcatIndexes[tokenId] = bugcatIndex;
        emit Mint(to, tokenId, bugcatIndex);
    }

    function mintBatch(address[] memory to, uint256[] memory tokenIds) public {
        require(msg.sender == minter, "not minter");
        require(to.length == tokenIds.length, "length mismatch");
        for (uint256 i = 0; i < to.length; i++) {
            _mint(to[i], tokenIds[i]);
            uint8 bugcatIndex = _choose(i + 1);
            bugcatIndexes[tokenIds[i]] = bugcatIndex;
            emit Mint(to[i], tokenIds[i], bugcatIndex);
        }
    }

    function switchTheme(uint256 tokenId) external {
        require(ownerOf(tokenId) == msg.sender, "not caretaker");
        lights[tokenId] = !lights[tokenId];
    }

    function compile(uint256 tokenId) external {
        require(ownerOf(tokenId) == msg.sender, "not caretaker");
        compileds[tokenId] = true;
    }

    function decompile(uint256 tokenId) external {
        require(ownerOf(tokenId) == msg.sender, "not caretaker");
        compileds[tokenId] = false;
    }

    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        address bugcat = IBugcatsRegistry(registry).bugs(bugcatIndexes[tokenId]);
        string memory html = IRender(renderer).render(tokenId, ownerOf(tokenId), bugcat, codes[bugcat], lights[tokenId], compileds[tokenId]);
        string memory json = string.concat(
            '{',
            '"name":"BUGCAT Codex #', tokenId.toString(), '",',
            '"description":"BUGCATs wander. The Codex remembers.",',
            '"image":"', string.concat("data:text/html;base64,", Base64.encode(bytes(html))), '"',
            '}'
        );
        return string.concat("data:application/json;base64,", Base64.encode(bytes(json)));
    }

    function _choose(uint256 salt) internal view returns (uint8) {
        return uint8(uint256(keccak256(abi.encodePacked(block.timestamp, salt))) % bugcatCount);
    }

    function supportsInterface(bytes4 interfaceId) public view override(ERC721, ERC2981) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}

contracts/BugcatCodexRenderer.sol.content:
// SPDX-License-Identifier: WTFPL
pragma solidity ^0.8.30;

import "./utils/ENSResolver.sol";
import "solady/src/utils/LibString.sol";

interface IRender {
    function render(
        uint256 tokenId,
        address caretaker,
        address bugcat,
        string memory code,
        bool light,
        bool compiled
    ) external view returns (string memory);
}

contract BugcatCodexRenderer is IRender {

    function render(
        uint256 tokenId,
        address caretaker,
        address bugcat,
        string memory code,
        bool light,
        bool compiled
    ) external view override returns (string memory) {
        string memory caretakerStr;
        try ENSResolver.resolveAddress(caretaker) returns (string memory nameOrAddr) {
            caretakerStr = nameOrAddr;
        } catch {
            caretakerStr = LibString.toHexStringChecksummed(caretaker);
        }
        string memory bytecode = _hexFromBytes(bugcat.code, 0);
        string memory themeClass = light ? "light" : "dark";
        string memory codeContent;
        string memory commentContent;
        if (compiled) {
            codeContent = bytecode;
            commentContent = "";
        } else {
            codeContent = code;
            commentContent = string.concat("<!-- ", bytecode, " -->");
        }

        string memory html = string.concat(
            "<!DOCTYPE html>",
            "<html>",
            "<head>",
            "<meta charset=\"UTF-8\">",
            "<style>",
            "body{margin:0;height:100vh;font-family:monospace;font-size:1.7vmin;line-height:1.5;letter-spacing:0.1em;white-space:pre-wrap;display:flex;align-items:center;justify-content:center}",
            "body>div{width:100vmin;height:100vmin;display:flex;flex-direction:column;padding:4vmin 6vmin 6vmin 6vmin;box-sizing:border-box}",
            "body>div>div:first-child{font-size:1.4vmin;margin:1.5vmin 0 4vmin 0}",
            "body>div>div:last-child{flex:1;overflow:hidden;word-break:break-all}",
            ".light{background:#f5f5f5}",
            ".light>div{background:white;color:#3a3a3a}",
            ".light>div>div:first-child{color:#3a3a3a}",
            ".dark{background:#0a0a0a}",
            ".dark>div{background:#1a1a1a;color:#e0e0e0}",
            ".dark>div>div:first-child{color:#e0e0e0}",
            "</style>",
            "</head>",
            "<body class=\"", themeClass, "\">",
            "<div>",
            "<div>Codex #", _toString(tokenId), " preserved by ", caretakerStr, "</div>",
            "<div>", codeContent, "</div>",
            "</div>",
            commentContent,
            "</body>",
            "</html>"
            );

        return html;
    }

    function _hexFromBytes(bytes memory data, uint256 maxChars) internal pure returns (string memory) {
        if (data.length == 0) return "";
        bytes memory HEX = "0123456789abcdef";
        uint256 avail = data.length * 2;
        uint256 outLen = (maxChars == 0 || maxChars > avail) ? avail : maxChars;
        bytes memory out = new bytes(outLen);
        uint256 pairs = outLen / 2;
        for (uint256 i = 0; i < pairs; i++) {
            uint8 b = uint8(data[i]);
            out[2*i]   = HEX[b >> 4];
            out[2*i+1] = HEX[b & 0x0f];
        }
        return string(out);
    }

    function _toString(uint256 value) internal pure returns (string memory str) {
        if (value == 0) return "0";
        uint256 temp = value; uint256 digits;
        while (temp != 0) { digits++; temp /= 10; }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        str = string(buffer);
    }
}

contracts/utils/ENSResolver.sol.content:
// SPDX-License-Identifier: MIT
// Author: @yigitduman
// Source: https://github.com/ygtdmn/drakeflipping/blob/main/src/DrakeflippingRenderer.sol
pragma solidity >=0.8.0;

import "solady/src/utils/LibString.sol";
import { ENS } from "@ensdomains/ens-contracts/contracts/registry/ENS.sol";
import { IReverseRegistrar } from "@ensdomains/ens-contracts/contracts/reverseRegistrar/IReverseRegistrar.sol";
import { INameResolver } from "@ensdomains/ens-contracts/contracts/resolvers/profiles/INameResolver.sol";

library ENSResolver {
    /**
     * @notice Retrieves the ENS name or checksummed address for a given address.
     * @param addr The address to retrieve the ENS name or checksummed address for.
     * @return The ENS name if available, otherwise the checksummed address.
     */
    function resolveAddress(address addr) external view returns (string memory) {
        ENS ens = ENS(0x00000000000C2E074eC69A0dFb2997BA6C7d2e1e);
        IReverseRegistrar reverseRegistrar = IReverseRegistrar(0xa58E81fe9b61B5c3fE2AFD33CF304c454AbFc7Cb);
        bytes32 node = reverseRegistrar.node(addr);
        address resolverAddress = ens.resolver(node);

        if (resolverAddress != address(0)) {
            // If the resolver is not the zero address, try to get the name from the resolver
            try INameResolver(resolverAddress).name(node) returns (string memory name) {
                // If a name is found and it's not empty, return it
                if (bytes(name).length > 0) {
                    return name;
                }
            } catch {}
        }

        // If no valid name is found, return the address as a string
        return LibString.toHexStringChecksummed(addr);
    }
}

